import React, {Component} from 'react'
import './App.css';
import peopleInfo from './component/peopleInfo'



class App extends Component{
  constructor(){
    super()
    this.state= {
      info:peopleInfo,
      count: 0

    }
    this.next = this.next.bind(this)
  }

  next(){
    this.setState({
      count:this.count + 1
    })
  }

  previous(){
    this.setState({
      count:this.count -1
    })
  }

  render() {
    let {count} = this.state
    return (
      <body>
        <div className='App'>
          <h1>{peopleInfo[count].name.lastName}, {peopleInfo[count].name.firstName} {peopleInfo[count].name.middleInital}</h1>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>
          <h2>Lives in: {peopleInfo[0].liveIn}</h2>
          <h2>Contact Info :  </h2>
            <ul>
              <li>Phone#: {peopleInfo[0].contacts.phoneNumber}</li>
              <li>Email: {peopleInfo[0].contacts.email}</li>
            </ul>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>
          <button onClick={this.next}>Next</button>
        </div>
      </body>
    )
  }
}

export default App;
